GMR_command_data = {
	["account"] = {"0","Syntax: .account Display the access level of your account."},
	["account characters"] = {"4","Syntax: .account characters [#accountId|$accountName] Show list all characters for account seelcted by provided #accountId or $accountName, or for selected player in game."},
	["account create"] = {"4","Syntax: .account create $account $password Create account and set password to it."},
	["account delete"] = {"5","Syntax: .account delete $account Delete account with all characters."},
	["account lock"] = {"0","Syntax: .account lock [on|off] Allow login from account only from current used IP or remove this requirement."},
	["account onlinelist"] = {"5","Syntax: .account onlinelist Show list of online accounts."},
	["account password"] = {"0","Syntax: .account password $old_password $new_password $new_password Change your account password."},
	["account set gmlevel"] = {"5","Syntax: .account set gmlevel [#accountId|$accountName] #level Set the security level for targeted player (can't be used at self) or for #accountId or $accountName to a level of #level. #level may range from 0 to 3."},
	["account set password"] = {"4","Syntax: .account set password (#accountId|$accountName) $password $password Set password for account."},
	["additem"] = {"4","Syntax: .additem #itemid/[#itemname]/#shift-click-item-link #itemcount Adds the specified number of items of id #itemid (or exact (!) name $itemname in brackets, or link created by shift-click at item in inventory or recipe) to your or selected character inventory. If #itemcount is omitted, only one item will be added. ."},
	["additemset"] = {"4","Syntax: .additemset #itemsetid Add items from itemset of id #itemsetid to your or selected character inventory. Will add by one example each item from itemset."},
	["announce"] = {"3","Syntax: .announce $MessageToBroadcast Send a global message to all players online in chat log."},
	["auction"] = {"4","Syntax: .auction Show your team auction store."},
	["auction alliance"] = {"4","Syntax: .auction alliance Show alliance auction store independent from your team."},
	["auction goblin"] = {"4","Syntax: .auction goblin Show goblin auction store common for all teams."},
	["auction horde"] = {"4","Syntax: .auction horde Show horde auction store independent from your team."},
	["aura"] = {"3","Syntax: .aura #spellid Add the aura from spell #spellid to the selected Unit."},
	["ban account"] = {"3","Syntax: .ban account $Name $bantime $reason Ban account kick player. $bantime: negative value leads to permban, otherwise use a timestring like 4d20h3s."},
	["ban character"] = {"3","Syntax: .ban character $Name $bantime $reason Ban account and kick player. $bantime: negative value leads to permban, otherwise use a timestring like 4d20h3s."},
	["ban ip"] = {"3","Syntax: .ban ip $Ip $bantime $reason Ban IP. $bantime: negative value leads to permban, otherwise use a timestring like 4d20h3s."},
	["ban spammer"] = {"3","Syntax: .ban spammer [$player_name] Ban account and IP for 1 hour and kick player."},
	["baninfo account"] = {"2","Syntax: .baninfo account $accountid Watch full information about a specific ban."},
	["baninfo character"] = {"2","Syntax: .baninfo character $charactername  Watch full information about a specific ban."},
	["baninfo ip"] = {"2","Syntax: .baninfo ip $ip Watch full information about a specific ban."},
	["bank"] = {"3","Syntax: .bank Show your bank inventory."},
	["banlist account"] = {"3","Syntax: .banlist account [$Name] Searches the banlist for a account name pattern or show full list account bans."},
	["banlist character"] = {"3","Syntax: .banlist character $Name Searches the banlist for a character name pattern. Pattern required."},
	["banlist ip"] = {"3","Syntax: .banlist ip [$Ip] Searches the banlist for a IP pattern or show full list of IP bans."},
	["bg"] = {"3","Syntax: .bg bgname (ws, ab or av)"},
	["cast"] = {"3","Syntax: .cast #spellid [triggered]   Cast #spellid to selected target. If no target selected cast to self. If 'trigered' or part provided then spell casted with triggered flag."},
	["cast back"] = {"3","Syntax: .cast back #spellid [triggered]   Selected target will cast #spellid to your character. If 'trigered' or part provided then spell casted with triggered flag."},
	["cast dist"] = {"3","Syntax: .cast dist #spellid [#dist [triggered]]   You will cast spell to pint at distance #dist. If 'trigered' or part provided then spell casted with triggered flag. Not all spells can be casted as area spells."},
	["cast self"] = {"3","Syntax: .cast self #spellid [triggered] Cast #spellid by target at target itself. If 'trigered' or part provided then spell casted with triggered flag."},
	["cast target"] = {"3","Syntax: .cast target #spellid [triggered]   Selected target will cast #spellid to his victim. If 'trigered' or part provided then spell casted with triggered flag."},
	["character deleted delete"] = {"5","Syntax: .character deleted delete #guid|$name Completely deletes the selected characters. If $name is supplied, only characters with that string in their name will be deleted, if #guid is supplied, only the character with that GUID will be deleted."},
	["character deleted list"] = {"4","Syntax: .character deleted list [#guid|$name] Shows a list with all deleted characters. If $name is supplied, only characters with that string in their name will be selected, if #guid is supplied, only the character with that GUID will be selected."},
	["character deleted old"] = {"4","Syntax: .character deleted old [#keepDays] Completely deletes all characters with deleted time longer #keepDays. If #keepDays not provided the  used value from mangosd.conf option 'CharDelete.KeepDays'. If referenced config option disabled (use 0 value) then command can't be used without #keepDays."},
	["character deleted restore"] = {"4","Syntax: .character deleted restore #guid|$name [$newname] [#new account] Restores deleted characters. If $name is supplied, only characters with that string in their name will be restored, if $guid is supplied, only the character with that GUID will be restored. If $newname is set, the character will be restored with that name instead of the original one. If #newaccount is set, the character will be restored to specific account character list. This works only with one character!"},
	["character erase"] = {"4","Syntax: .character erase $name Delete character $name. Character finally deleted in case any deleting options."},
	["character level"] = {"4","Syntax: .character level [$playername] [#level] Set the level of character with $playername (or the selected if not name provided) by #numberoflevels Or +1 if no #numberoflevels provided). If #numberoflevels is omitted, the level will be increase by 1. If #numberoflevels is 0, the same level will be restarted. If no character is selected and name not provided, increase your level. Command can be used for offline character. All stats and dependent values recalculated. At level decrease talents can be reset if need. Also at level decrease equipped items with greater level requirement can be lost."},
	["character rename"] = {"4","Syntax: .character rename [$name] Mark selected in game or by $name in command character for rename at next login."},
	["character reputation"] = {"4","Syntax: .character reputation [$player_name] Show reputation information for selected player or player find by $player_name."},
	["combatstop"] = {"2","Syntax: .combatstop [$playername] Stop combat for selected character. If selected non-player then command applied to self. If $playername provided then attempt applied to online player $playername."},
	["commands"] = {"0","Syntax: .commands Display a list of available commands for your account level."},
	["cooldown"] = {"3","Syntax: .cooldown [#spell_id] Remove all (if spell_id not provided) or #spel_id spell cooldown from selected character or you (if no selection)."},
	["damage"] = {"3","Syntax: .damage $damage_amount [$school [$spellid]] Apply $damage to target. If not $school and $spellid provided then this flat clean melee damage without any modifiers. If $school provided then damage modified by armor reduction (if school physical), and target absorbing modifiers and result applied as melee damage to target. If spell provided then damage modified and applied as spell damage. $spellid can be shift-link."},
	["debug anim"] = {"4","Syntax: .debug anim #emoteid Play emote #emoteid for your character."},
	["debug bg"] = {"4","Syntax: .debug bg Toggle debug mode for battlegrounds. In debug mode GM can start battleground with single player."},
	["debug getitemvalue"] = {"4","Syntax: .debug getitemvalue #itemguid #field [int|hex|bit|float] Get the field #field of the item #itemguid in your inventroy. Use type arg for set output format: int (decimal number), hex (hex value), bit (bitstring), float. By default use integer output."},
	["debug getvalue"] = {"4","Syntax: .debug getvalue #field [int|hex|bit|float] Get the field #field of the selected target. If no target is selected, get the content of your field. Use type arg for set output format: int (decimal number), hex (hex value), bit (bitstring), float. By default use integer output."},
	["debug moditemvalue"] = {"4","Syntax: .debug moditemvalue #guid #field [int|float| &= | |= | &=~ ] #value Modify the field #field of the item #itemguid in your inventroy by value #value.  Use type arg for set mode of modification: int (normal add/subtract #value as decimal number), float (add/subtract #value as float number), &= (bit and, set to 0 all bits in value if it not set to 1 in #value as hex number), |= (bit or, set to 1 all bits in value if it set to 1 in #value as hex number), &=~ (bit and not, set to 0 all bits in value if it set to 1 in #value as hex number). By default expect integer add/subtract."},
	["debug modvalue"] = {"4","Syntax: .debug modvalue #field [int|float| &= | |= | &=~ ] #value Modify the field #field of the selected target by value #value. If no target is selected, set the content of your field. Use type arg for set mode of modification: int (normal add/subtract #value as decimal number), float (add/subtract #value as float number), &= (bit and, set to 0 all bits in value if it not set to 1 in #value as hex number), |= (bit or, set to 1 all bits in value if it set to 1 in #value as hex number), &=~ (bit and not, set to 0 all bits in value if it set to 1 in #value as hex number). By default expect integer add/subtract."},
	["debug play cinematic"] = {"4","Syntax: .debug play cinematic #cinematicid Play cinematic #cinematicid for you. You stay at place while your mind fly."},
	["debug play sound"] = {"4","Syntax: .debug play sound #soundid Play sound with #soundid. Sound will be play only for you. Other players do not hear this. Warning: client may have more 5000 sounds..."},
	["debug setitemvalue"] = {"4","Syntax: .debug setitemvalue #guid #field [int|hex|bit|float] #value Set the field #field of the item #itemguid in your inventroy to value #value. Use type arg for set input format: int (decimal number), hex (hex value), bit (bitstring), float. By default expect integer input format."},
	["debug setvalue"] = {"4","Syntax: .debug setvalue #field [int|hex|bit|float] #value Set the field #field of the selected target to value #value. If no target is selected, set the content of your field. Use type arg for set input format: int (decimal number), hex (hex value), bit (bitstring), float. By default expect integer input format."},
	["debug spellcoefs"] = {"4","Syntax: .debug spellcoefs #spellid Show default calculated and DB stored coefficients for direct/dot heal/damage."},
	["debug spellmods"] = {"4","Syntax: .debug spellmods (flat|pct) #spellMaskBitIndex #spellModOp #value Set at client side spellmod affect for spell that have bit set with index #spellMaskBitIndex in spell family mask for values dependent from spellmod #spellModOp to #value."},
	["delticket"] = {"1","Syntax: .delticket all         .delticket #num         .delticket $character_name all to dalete all tickets at server, $character_name to delete ticket of this character, #num to delete ticket #num."},
	["demorph"] = {"3","Syntax: .demorph Demorph the selected player."},
	["die"] = {"3","Syntax: .die Kill the selected player. If no player is selected, it will kill you."},
	["dismount"] = {"0","Syntax: .dismount Dismount you, if you are mounted."},
	["distance"] = {"3","Syntax: .distance [$name/$link] Display the distance from your character to the selected creature/player, or player with name $name, or player/creature/gameobject pointed to shift-link with guid."},
	["event"] = {"4","Syntax: .event #event_id Show details about event with #event_id."},
	["event list"] = {"3","Syntax: .event list Show list of currently active events. Show list of all events"},
	["event start"] = {"4","Syntax: .event start #event_id Start event #event_id. Set start time for event to current moment (change not saved in DB)."},
	["event stop"] = {"4","Syntax: .event stop #event_id Stop event #event_id. Set start time for event to time in past that make current moment is event stop time (change not saved in DB)."},
	["explorecheat"] = {"3","Syntax: .explorecheat #flag Reveal  or hide all maps for the selected player. If no player is selected, hide or reveal maps to you. Use a #flag of value 1 to reveal, use a #flag value of 0 to hide all maps."},
	["get blockchance"] = {"3","Syntax: .get blockchance . Display real your block chance from server for players and target's for GM."},
	["get dodgechance"] = {"3","Syntax: .get dodgechance . Display real your dodge chance from server for players and target's for GM."},
	["get hitchance"] = {"3","Syntax: .get hitchance . Display real your hit chances from server for players and target's for GM."},
	["get meleecritchance"] = {"3","Syntax: .get meleecritchance . Display real your melee crit chance from server for players and target's for GM."},
	["get parrychance"] = {"3","Syntax: .get parrychance . Display real your parry chance from server for players and target's for GM."},
	["get rangedcritchance"] = {"3","Syntax: .get rangedcritchance . Display real your ranged crit chance from server for players and target's for GM."},
	["get spellcritchance"] = {"3","Syntax: .get spellcritchance . Display real your spell crit chances from server for players and target's for GM. If you want spellcrit of some spell, you can add spellid aftr command. Example: .get spellcritchance 25306 (display crit chance of spell Fireball Rank 12)"},
	["gm"] = {"1","Syntax: .gm [on/off] Enable or Disable in game GM MODE or show current state of on/off not provided."},
	["gm chat"] = {"1","Syntax: .gm chat [on/off] Enable or disable chat GM MODE (show gm badge in messages) or show current state of on/off not provided."},
	["gm ingame"] = {"0","Syntax: .gm ingame Display a list of available in game Game Masters."},
	["gm list"] = {"3","Syntax: .gm list Display a list of all Game Masters accounts and security levels."},
	["gm setview"] = {"1","Syntax: .gm setview Set farsight view on selected unit. Select yourself to set view back."},
	["gm visible"] = {"1","Syntax: .gm visible on/off Output current visibility state or make GM visible(on) and invisible(off) for other players."},
	["gmannounce"] = {"3","Syntax: .gmannounce $MessageToBroadcast Send a global message to all players online in chat log with colored sender's name."},
	["go"] = {"2","Syntax: .go  [$playername|pointlink|#x #y #z [#mapid]] Teleport your character to point with coordinates of player $playername, or coordinates of one from shift-link types: player, tele, taxinode, creature/creature_entry, gameobject/gameobject_entry, or explicit #x #y #z #mapid coordinates."},
	["go creature"] = {"2","Syntax: .go creature (#creature_guid|$creature_name|id #creature_id) Teleport your character to creature with guid #creature_guid, or teleport your character to creature with name including as part $creature_name substring, or teleport your character to a creature that was spawned from the template with this entry #creature_id."},
	["go graveyard"] = {"2","Syntax: .go graveyard #graveyardId  Teleport to graveyard with the graveyardId specified."},
	["go grid"] = {"2","Syntax: .go grid #gridX #gridY [#mapId] Teleport the gm to center of grid with provided indexes at map #mapId (or current map if it not provided)."},
	["go object"] = {"2","Syntax: .go object (#gameobject_guid|$gameobject_name|id #gameobject_id) Teleport your character to gameobject with guid #gameobject_guid, or teleport your character to gameobject with name including as part $gameobject_name substring, or teleport your character to a gameobject that was spawned from the template with this entry #gameobject_id."},
	["go taxinode"] = {"2","Syntax: .go taxinode #taxinode Teleport player to taxinode coordinates. You can look up zone using .lookup taxinode $namepart"},
	["go trigger"] = {"2","Syntax: .go trigger (#trigger_id|$trigger_shift-link|$trigger_target_shift-link) [target] Teleport your character to areatrigger with id #trigger_id or trigger id associated with shift-link. If additional arg target provided then character will telported to areatrigger target point."},
	["go xy"] = {"2","Syntax: .go xy #x #y [#mapid] Teleport player to point with (#x,#y) coordinates at ground(water) level at map #mapid or same map if #mapid not provided."},
	["go xyz"] = {"2","Syntax: .go xyz #x #y #z [#mapid] Teleport player to point with (#x,#y,#z) coordinates at ground(water) level at map #mapid or same map if #mapid not provided."},
	["go zonexy"] = {"2","Syntax: .go zonexy #x #y [#zone] Teleport player to point with (#x,#y) client coordinates at ground(water) level in zone #zoneid or current zone if #zoneid not provided. You can look up zone using .lookup area $namepart"},
	["gobject add"] = {"4","Syntax: .gobject add #id <spawntimeSecs> Add a game object from game object templates to the world at your current location using the #id. spawntimesecs sets the spawntime, it is optional. Note: this is a copy of .gameobject."},
	["gobject delete"] = {"4","Syntax: .gobject delete #go_guid Delete gameobject with guid #go_guid."},
	["gobject move"] = {"4","Syntax: .gobject move #goguid [#x #y #z] Move gameobject #goguid to character coordinates (or to (#x,#y,#z) coordinates if its provide)."},
	["gobject near"] = {"2","Syntax: .gobject near  [#distance] Output gameobjects at distance #distance from player. Output gameobject guids and coordinates sorted by distance from character. If #distance not provided use 10 as default value."},
	["gobject target"] = {"2","Syntax: .gobject target [#go_id|#go_name_part] Locate and show position nearest gameobject. If #go_id or #go_name_part provide then locate and show position of nearest gameobject with gameobject template id #go_id or name included #go_name_part as part."},
	["gobject turn"] = {"4","Syntax: .gobject turn #goguid  Set for gameobject #goguid orientation same as current character orientation."},
	["goname"] = {"2","Syntax: .goname [$charactername] Teleport to the given character. Either specify the character name or click on the character's portrait, e.g. when you are in a group. Character can be offline."},
	["gps"] = {"2","Syntax: .gps [$name|$shift-link] Display the position information for a selected character or creature (also if player name $name provided then for named player, or if creature/gameobject shift-link provided then pointed creature/gameobject if it loaded). Position information includes X, Y, Z, and orientation, map Id and zone Id"},
	["groupgo"] = {"2","Syntax: .groupgo [$charactername] Teleport the given character and his group to you. Teleported only online characters but original selected group member can be offline."},
	["guid"] = {"4","Syntax: .guid Display the GUID for the selected character."},
	["guild create"] = {"4","Syntax: .guild create [$GuildLeaderName] $GuildName Create a guild named $GuildName with the player $GuildLeaderName (or selected) as leader.  Guild name must in quotes."},
	["guild delete"] = {"4","Syntax: .guild delete $GuildName Delete guild $GuildName. Guild name must in quotes."},
	["guild invite"] = {"4","Syntax: .guild invite [$CharacterName] $GuildName Add player $CharacterName (or selected) into a guild $GuildName. Guild name must in quotes."},
	["guild rank"] = {"4","Syntax: .guild rank $CharacterName #Rank Set for $CharacterName rank #Rank in a guild."},
	["guild uninvite"] = {"4","Syntax: .guild uninvite [$CharacterName] Remove player $CharacterName (or selected) from a guild."},
	["help"] = {"0","Syntax: .help [$command] Display usage instructions for the given $command. If no $command provided show list available commands."},
	["hidearea"] = {"2","Syntax: .hidearea #areaid Hide the area of #areaid to the selected character. If no character is selected, hide this area to you."},
	["honor add"] = {"4","Syntax: .honor add $amount Add a certain amount of honor (gained in lifetime) to the selected player."},
	["honor addkill"] = {"4","Syntax: .honor addkill Add the targeted unit as one of your pvp kills today (you only get honor if it's a racial leader or a player)"},
	["honor setrp"] = {"4","Syntax: .honor setrp $value Set a rank points to selected player."},
	["honor show"] = {"3","Syntax: .honor show Display the honor stats of the selected player"},
	["honor update"] = {"4","Syntax: .honor update Force honor to be update"},
	["hover"] = {"2","Syntax: .hover #flag Enable or disable hover mode for your character. Use a #flag of value 1 to enable, use a #flag value of 0 to disable hover."},
	["instance listbinds"] = {"3","Syntax: .instance listbinds   Lists the binds of the selected player."},
	["instance savedata"] = {"3","Syntax: .instance savedata   Save the InstanceData for the current player's map to the DB."},
	["instance stats"] = {"3","Syntax: .instance stats   Shows statistics about instances."},
	["instance unbind"] = {"3","Syntax: .instance unbind all   All of the selected player's binds will be cleared. .instance unbind #mapid  Only the specified #mapid instance will be cleared."},
	["itemmove"] = {"3","Syntax: .itemmove #sourceslotid #destinationslotid Move an item from slots #sourceslotid to #destinationslotid in your inventory Not yet implemented"},
	["kick"] = {"2","Syntax: .kick [$charactername] Kick the given character name from the world. If no character name is provided then the selected player (except for yourself) will be kicked."},
	["learn"] = {"3","Syntax: .learn #spell [all] Selected character learn a spell of id #spell. If 'all' provided then all ranks learned."},
	["learn all"] = {"4","Syntax: .learn all Learn all big set different spell maybe useful for Administaror."},
	["learn all_crafts"] = {"4","Syntax: .learn crafts Learn all professions and recipes."},
	["learn all_default"] = {"4","Syntax: .learn all_default [$playername] Learn for selected/$playername player all default spells for his race/class and spells rewarded by completed quests."},
	["learn all_gm"] = {"4","Syntax: .learn all_gm Learn all default spells for Game Masters."},
	["learn all_lang"] = {"3","Syntax: .learn all_lang Learn all languages"},
	["learn all_myclass"] = {"3","Syntax: .learn all_myclass Learn all spells and talents available for his class."},
	["learn all_myspells"] = {"3","Syntax: .learn all_myspells Learn all spells (except talents and spells with first rank learned as talent) available for his class."},
	["learn all_mytalents"] = {"3","Syntax: .learn all_mytalents Learn all talents (and spells with first rank learned as talent) available for his class."},
	["learn all_recipes"] = {"4","Syntax: .learn all_recipes [$profession] Learns all recipes of specified profession and sets skill level to max. Example: .learn all_recipes enchanting"},
	["levelup"] = {"4","Syntax: .levelup [$playername] [#numberoflevels] Increase/decrease the level of character with $playername (or the selected if not name provided) by #numberoflevels Or +1 if no #numberoflevels provided). If #numberoflevels is omitted, the level will be increase by 1. If #numberoflevels is 0, the same level will be restarted. If no character is selected and name not provided, increase your level. Command can be used for offline character. All stats and dependent VALUESrecalculated. At level decrease talents can be reset if need. Also at level decrease equipped items with greater level requirement can be lost."},
	["linkgrave"] = {"3","Syntax: .linkgrave #graveyard_id [alliance|horde] Link current zone to graveyard for any (or alliance/horde faction ghosts). This let character ghost from zone teleport to graveyard after die if graveyard is nearest from linked to zone and accept ghost of this faction. Add only single graveyard at another map and only if no graveyards linked (or planned linked at same map)."},
	["list creature"] = {"2","Syntax: .list creature #creature_id [#max_count] Output creatures with creature id #creature_id found in world. Output creature guids and coordinates sorted by distance from character. Will be output maximum #max_count creatures. If #max_count not provided use 10 as default value."},
	["list item"] = {"2","Syntax: .list item #item_id [#max_count] Output items with item id #item_id found in all character inventories, mails, auctions, and guild banks. Output item guids, item owner guid, owner account and owner name (guild name and guid in case guild bank). Will be output maximum #max_count items. If #max_count not provided use 10 as default value."},
	["list object"] = {"2","Syntax: .list object #gameobject_id [#max_count] Output gameobjects with gameobject id #gameobject_id found in world. Output gameobject guids and coordinates sorted by distance from character. Will be output maximum #max_count gameobject. If #max_count not provided use 10 as default value."},
	["list talents"] = {"3","Syntax: .list talents Show list all really known (as learned spells) talent rank spells for selected player or self."},
	["loadscripts"] = {"3","Syntax: .loadscripts $scriptlibraryname Unload current and load the script library $scriptlibraryname or reload current if $scriptlibraryname omitted, in case you changed it while the server was running."},
	["lookup account email"] = {"3","Syntax: .lookup account email $emailpart [#limit]   Searchs accounts, which email including $emailpart with optional parametr #limit of results. If #limit not provided expected 100."},
	["lookup account ip"] = {"3","Syntax: lookup account ip $ippart [#limit]   Searchs accounts, which last used ip inluding $ippart (textual) with optional parametr #$limit of results. If #limit not provided expected 100."},
	["lookup account name"] = {"3","Syntax: .lookup account name $accountpart [#limit]   Searchs accounts, which username including $accountpart with optional parametr #limit of results. If #limit not provided expected 100."},
	["lookup area"] = {"2","Syntax: .lookup area $namepart Looks up an area by $namepart, and returns all matches with their area ID's."},
	["lookup creature"] = {"2","Syntax: .lookup creature $namepart Looks up a creature by $namepart, and returns all matches with their creature ID's."},
	["lookup event"] = {"2","Syntax: .lookup event $name Attempts to find the ID of the event with the provided $name."},
	["lookup faction"] = {"2","Syntax: .lookup faction $name Attempts to find the ID of the faction with the provided $name."},
	["lookup item"] = {"2","Syntax: .lookup item $itemname Looks up an item by $itemname, and returns all matches with their Item ID's."},
	["lookup itemset"] = {"2","Syntax: .lookup itemset $itemname Looks up an item set by $itemname, and returns all matches with their Item set ID's."},
	["lookup object"] = {"2","Syntax: .lookup object $objname Looks up an gameobject by $objname, and returns all matches with their Gameobject ID's."},
	["lookup player account"] = {"3","Syntax: .lookup player account $accountpart [#limit]   Searchs players, which account username including $accountpart with optional parametr #limit of results. If #limit not provided expected 100."},
	["lookup player email"] = {"3","Syntax: .lookup player email $emailpart [#limit]   Searchs players, which account email including $emailpart with optional parametr #limit of results. If #limit not provided expected 100."},
	["lookup player ip"] = {"3","Syntax: .lookup player ip $ippart [#limit]   Searchs players, which account last used ip inluding $ippart (textual) with optional parametr #limit of results. If #limit not provided expected 100."},
	["lookup quest"] = {"2","Syntax: .lookup quest $namepart Looks up a quest by $namepart, and returns all matches with their quest ID's."},
	["lookup skill"] = {"2","Syntax: .lookup skill $$namepart Looks up a skill by $namepart, and returns all matches with their skill ID's."},
	["lookup spell"] = {"2","Syntax: .lookup spell $namepart Looks up a spell by $namepart, and returns all matches with their spell ID's."},
	["lookup taxinode"] = {"2","Syntax: .lookup taxinode $substring Search and output all taxinodes with provide $substring in name."},
	["lookup tele"] = {"2","Syntax: .lookup tele $substring Search and output all .tele command locations with provide $substring in name."},
	["maxskill"] = {"3","Syntax: .maxskill Sets all skills of the targeted player to their maximum VALUESfor its current level."},
	["modify aspeed"] = {"3","Syntax: .modify aspeed #rate Modify all speeds -run,swim,run back,swim back- of the selected player to normalbase speed for this move type*rate. If no player is selected, modify your speed.  #rate may range from 0.1 to 10."},
	["modify bwalk"] = {"3","Syntax: .modify bwalk #rate Modify the speed of the selected player while running backwards to normal walk back speed*rate. If no player is selected, modify your speed.  #rate may range from 0.1 to 10."},
	["modify drunk"] = {"3","Syntax: .modify drunk #value  Set drunk level to #value (0..100). Value 0 remove drunk state, 100 is max drunked state."},
	["modify energy"] = {"3","Syntax: .modify energy #energy Modify the energy of the selected player. If no player is selected, modify your energy."},
	["modify faction"] = {"3","Syntax: .modify faction #factionid #flagid #npcflagid #dynamicflagid Modify the faction and flags of the selected creature. Without arguments, display the faction and flags of the selected creature."},
	["modify gender"] = {"3","Syntax: .modify gender male/female Change gender of selected player."},
	["modify honor"] = {"4","Syntax: .modify honor $field $value Add $value to an honor $field (it's just for debug , values won't be saved at player logout) Field list: points / rank / todaykills / yesterdaykills / yesterdayhonor / thisweekkills / thisweekhonor / lastweekkills / lastweekhonor / lastweekstanding / lifetimedishonorablekills / lifetimehonorablekills "},
	["modify hp"] = {"3","Syntax: .modify hp #newhp Modify the hp of the selected player. If no player is selected, modify your hp."},
	["modify mana"] = {"3","Syntax: .modify mana #newmana Modify the mana of the selected player. If no player is selected, modify your mana."},
	["modify money"] = {"4","Syntax: .modify money #money .money #money Add or remove money to the selected player. If no player is selected, modify your money.  #gold can be negative to remove money."},
	["modify morph"] = {"3","Syntax: .modify morph #displayid Change your current model id to #displayid."},
	["modify mount"] = {"3","Syntax: .modify mount #id #speed Display selected player as mounted at #id creature and set speed to #speed value."},
	["modify rage"] = {"3","Syntax: .modify rage #newrage Modify the rage of the selected player. If no player is selected, modify your rage."},
	["modify rep"] = {"3","Syntax: .modify rep #repId (#repvalue | $rankname [#delta]) Sets the selected players reputation with faction #repId to #repvalue or to $reprank. If the reputation rank name is provided, the resulting reputation will be the lowest reputation for that rank plus the delta amount, if specified. You can use '.pinfo rep' to list all known reputation ids, or use '.lookup faction $name' to locate a specific faction id."},
	["modify scale"] = {"3","Syntax: .modify scale #scale Change model scale for targeted player (util relogin) or creature (until respawn)."},
	["modify speed"] = {"2","Syntax: .modify speed #rate .speed #rate Modify the running speed of the selected player to normal base run speed*rate. If no player is selected, modify your speed.  #rate may range from 0.1 to 10."},
	["modify standstate"] = {"3","Syntax: .modify standstate #emoteid Change the emote of your character while standing to #emoteid."},
	["modify swim"] = {"3","Syntax: .modify swim #rate Modify the swim speed of the selected player to normal swim speed*rate. If no player is selected, modify your speed.  #rate may range from 0.1 to 10."},
	["movegens"] = {"3","Syntax: .movegens   Show movement generators stack for selected creature or player."},
	["mute"] = {"2","Syntax: .mute [$playerName] $timeInMinutes Disible chat messaging for any character from account of character $playerName (or currently selected) at $timeInMinutes minutes. Player can be offline."},
	["namego"] = {"2","Syntax: .namego [$charactername] Teleport the given character to you. Character can be offline."},
	["neargrave"] = {"2","Syntax: .neargrave [alliance|horde] Find nearest graveyard linked to zone (or only nearest from accepts alliance or horde faction ghosts)."},
	["notify"] = {"2","Syntax: .notify $MessageToBroadcast Send a global message to all players online in screen."},
	["npc add"] = {"4","Syntax: .npc add #creatureid Spawn a creature by the given template id of #creatureid."},
	["npc additem"] = {"4","Syntax: .npc additem #itemId <#maxcount><#incrtime>r Add item #itemid to item list of selected vendor. Also optionally set max count item in vendor item list and time to item count restoring."},
	["npc addmove"] = {"4","Syntax: .npc addmove #creature_guid [#waittime] Add your current location as a waypoint for creature with guid #creature_guid. And optional add wait time."},
	["npc addweapon"] = {"4"," Syntax: .npc addweapon #slotid[1,2,3] #itemid #type[0,1,2] #newEquipId[0,id] Add weapon to selected creature in #slotid and #type. If type = 0 - weapon add temporary If type = 1 - weapon add forever(Update method) If type = 2 - weapon add forever(Write method)"},
	["npc aiinfo"] = {"2","Syntax: .npc npc aiinfo Show npc AI and script information."},
	["npc allowmove"] = {"4","Syntax: .npc allowmove Enable or disable movement creatures in world. Not implemented."},
	["npc changelevel"] = {"4","Syntax: .npc changelevel #level Change the level of the selected creature to #level. #level may range from 1 to 63."},
	["npc delete"] = {"4","Syntax: .npc delete [#guid] Delete creature with guid #guid (or the selected if no guid is provided)"},
	["npc delitem"] = {"4","Syntax: .npc delitem #itemId Remove item #itemid from item list of selected vendor."},
	["npc factionid"] = {"4","Syntax: .npc factionid #factionid Set the faction of the selected creature to #factionid."},
	["npc flag"] = {"3","Syntax: .npc flag #npcflag Set the NPC flags of creature template of the selected creature and selected creature to #npcflag. NPC flags will applied to all creatures of selected creature template after server restart or grid unload/load."},
	["npc follow"] = {"4","Syntax: .npc follow Selected creature start follow you until death/fight/etc."},
	["npc info"] = {"2","Syntax: .npc info Display a list of details for the selected creature. The list includes: - GUID, Faction, NPC flags, Entry ID, Model ID, - Level, - Health (current/maximum), - Field flags, dynamic flags, faction template,  - Position information, - and the creature type, e.g. if the creature is a vendor."},
	["npc move"] = {"4","Syntax: .npc move [#creature_guid] Move the targeted creature spawn point to your coordinates."},
	["npc name"] = {"4","Syntax: .npc name $name Change the name of the selected creature or character to $name. Command disabled."},
	["npc playemote"] = {"4","Syntax: .npc playemote #emoteid #type Make the selected creature emote with an emote of id #emoteid and #type[0,1,2]. If type = 0 - emote setup temporary If type = 1 - emote setup by GUID forever If type = 2 - emote setup by Entry forever"},
	["npc say"] = {"2","Syntax: .npc say #text Make the selected npc says #text."},
	["npc setdeathstate"] = {"4","Syntax: .npc setdeathstate on/off Set default death state (dead/alive) for npc at spawn."},
	["npc setmodel"] = {"4","Syntax: .npc setmodel #displayid Change the model id of the selected creature to #displayid."},
	["npc setmovetype"] = {"4","Syntax: .npc setmovetype [#creature_guid] stay/random/way [NODEL] Set for creature pointed by #creature_guid (or selected if #creature_guid not provided) movement type and move it to respawn position (if creature alive). Any existing waypoints for creature will be removed from the database if you do not use NODEL. If the creature is dead then movement type will applied at creature respawn. Make sure you use NODEL, if you want to keep the waypoints."},
	["npc spawndist"] = {"4","Syntax: .npc spawndist #dist Adjust spawndistance of selected creature to dist."},
	["npc spawntime"] = {"4","Syntax: .npc spawntime #time  Adjust spawntime of selected creature to time."},
	["npc subname"] = {"4","Syntax: .npc subname $Name Change the subname of the selected creature or player to $Name. Command disabled."},
	["npc tame"] = {"4","Syntax: .npc tame Tame selected creature (tameable non pet creature). You don't must have pet."},
	["npc textemote"] = {"4","Syntax: .npc textemote #emoteid Make the selected creature to do textemote with an emote of id #emoteid."},
	["npc unfollow"] = {"4","Syntax: .npc unfollow Selected creature (non pet) stop follow you."},
	["npc whisper"] = {"4","Syntax: .npc whisper #playerguid #text Make the selected npc whisper #text to  #playerguid."},
	["npc yell"] = {"4","Syntax: .npc yell #text Make the selected npc yells #text."},
	["pdump load"] = {"5","Syntax: .pdump load $filename $account [$newname] [$newguid] Load character dump from dump file into character list of $account with saved or $newname, with saved (or first free) or $newguid guid."},
	["pdump write"] = {"5","Syntax: .pdump write $filename $playerNameOrGUID Write character dump with name/guid $playerNameOrGUID to file $filename."},
	["pinfo"] = {"2","Syntax: .pinfo [$player_name] Output account information for selected player or player find by $player_name."},
	["quest add"] = {"4","Syntax: .quest add #quest_id Add to character quest log quest #quest_id. Quest started from item can't be added by this command but correct .additem call provided in command output."},
	["quest complete"] = {"4","Syntax: .quest complete #questid Mark all quest objectives as completed for target character active quest. After this target character can go and get quest reward."},
	["quest remove"] = {"4","Syntax: .quest remove #quest_id Set quest #quest_id state to not completed and not active (and remove from active quest list) for selected player."},
	["recall"] = {"4","Syntax: .recall [$playername] Teleport $playername or selected player to the place where he has been before last use of a teleportation command. If no $playername is entered and no player is selected, it will teleport you."},
	["reload all"] = {"4","Syntax: .reload all Reload all tables with reload support added and that can be _safe_ reloaded."},
	["reload all_area"] = {"4","Syntax: .reload all_area Reload all `areatrigger_*` tables if reload support added for this table and this table can be _safe_ reloaded."},
	["reload all_eventai"] = {"4","Syntax: .reload all_eventai Reload `creature_ai_*` tables if reload support added for these tables and these tables can be _safe_ reloaded."},
	["reload all_item"] = {"4","Syntax: .reload all_item Reload `item_required_target`, `page_texts` and `item_enchantment_template` tables."},
	["reload all_loot"] = {"4","Syntax: .reload all_loot Reload all `*_loot_template` tables. This can be slow operation with lags for server run."},
	["reload all_npc"] = {"4","Syntax: .reload all_npc Reload `points_of_interest` and `npc_*` tables if reload support added for these tables and these tables can be _safe_ reloaded."},
	["reload all_quest"] = {"4","Syntax: .reload all_quest Reload all quest related tables if reload support added for this table and this table can be _safe_ reloaded."},
	["reload all_scripts"] = {"4","Syntax: .reload all_scripts Reload `*_scripts` tables."},
	["reload all_spell"] = {"4","Syntax: .reload all_spell Reload all `spell_*` tables with reload support added and that can be _safe_ reloaded."},
	["reload config"] = {"4","Syntax: .reload config Reload config settings (by default stored in mangosd.conf). Not all settings can be change at reload: some new setting values will be ignored until restart, some values will applied with delay or only to new objects/maps, some values will explicitly rejected to change at reload."},
	["repairitems"] = {"3","Syntax: .repairitems Repair all selected player's items."},
	["reset all"] = {"5","Syntax: .reset all spells Syntax: .reset all talents Request reset spells or talents at next login each existed character."},
	["reset honor"] = {"4","Syntax: .reset honor [Playername]   Reset all honor data for targeted character."},
	["reset level"] = {"4","Syntax: .reset level [Playername]   Reset level to 1 including reset stats and talents.  Equipped items with greater level requirement can be lost."},
	["reset spells"] = {"4","Syntax: .reset spells [Playername]   Removes all non-original spells from spellbook. . Playername can be name of offline character."},
	["reset stats"] = {"4","Syntax: .reset stats [Playername]   Resets(recalculate) all stats of the targeted player to their original VALUESat current level."},
	["reset talents"] = {"4","Syntax: .reset talents [Playername]   Removes all talents of the targeted player. Playername can be name of offline character."},
	["respawn"] = {"3","Syntax: .respawn Respawn selected creature or respawn all nearest creatures (if none selected) and GO without waiting respawn time expiration."},
	["revive"] = {"2","Syntax: .revive Revive the selected player. If no player is selected, it will revive you."},
	["save"] = {"2","Syntax: .save Saves your character."},
	["saveall"] = {"2","Syntax: .saveall Save all characters in game."},
	["send items"] = {"3","Syntax: .send items #playername #subject #text itemid1[:count1] itemid2[:count2] ... itemidN[:countN] Send a mail to a player. Subject and mail text must be in . If for itemid not provided related count values then expected 1, if count > max items in stack then items will be send in required amount stacks. All stacks amount in mail limited to 12."},
	["send mail"] = {"1","Syntax: .send mail #playername #subject #text Send a mail to a player. Subject and mail text must be in ."},
	["send mass items"] = {"5","Syntax: .send mass items #racemask|$racename|alliance|horde|all #subject #text #itemid1[:#count1] #itemid2[:#count2] ... #itemidN[:#countN] Send a mail to players. Subject and mail text must be in . If for itemid not provided related count values then expected 1, if count > max items in stack then items will be send in required amount stacks. All stacks amount in mail limited to 12."},
	["send mass mail"] = {"5","Syntax: .send mass mail #racemask|$racename|alliance|horde|all $subject $text Send a mail to players. Subject and mail text must be in ."},
	["send mass money"] = {"5","Syntax: .send mass money #racemask|$racename|alliance|horde|all #subject #text #money Send mail with money to players. Subject and mail text must be in ."},
	["send message"] = {"1","Syntax: .send message $playername $message Send screen message to player from ADMINISTRATOR."},
	["send money"] = {"5","Syntax: .send money #playername #subject #text #money Send mail with money to a player. Subject and mail text must be in ."},
	["server corpses"] = {"5","Syntax: .server corpses Triggering corpses expire check in world."},
	["server exit"] = {"5","Syntax: .server exit Terminate mangosd NOW. Exit code 0."},
	["server idlerestart"] = {"4","Syntax: .server idlerestart #delay Restart the server after #delay seconds if no active connections are present (no players). Use #exist_code or 2 as program exist code."},
	["server idlerestart cancel"] = {"4","Syntax: .server idlerestart cancel Cancel the restart/shutdown timer if any."},
	["server idleshutdown"] = {"4","Syntax: .server idleshutdown #delay [#exist_code] Shut the server down after #delay seconds if no active connections are present (no players). Use #exist_code or 0 as program exist code."},
	["server idleshutdown cancel"] = {"4","Syntax: .server idleshutdown cancel Cancel the restart/shutdown timer if any."},
	["server info"] = {"0","Syntax: .server info Display server version and the number of connected players."},
	["server log filter"] = {"4","Syntax: .server log filter [($filtername|all) (on|off)] Show or set server log filters. If used all then all filters will be set to on/off state."},
	["server log level"] = {"4","Syntax: .server log level [#level] Show or set server log level (0 - errors only, 1 - basic, 2 - detail, 3 - debug)."},
	["server motd"] = {"5","Syntax: .server motd Show server Message of the day."},
	["server plimit"] = {"5","Syntax: .server plimit [#num|-1|-2|-3|reset|player|moderator|gamemaster|administrator] Without arg show current player amount and security level limitations for login to server, with arg set player linit ($num > 0) or securiti limitation ($num < 0 or security leme name. With `reset` sets player limit to the one in the config file"},
	["server restart"] = {"4","Syntax: .server restart #delay Restart the server after #delay seconds. Use #exist_code or 2 as program exist code."},
	["server restart cancel"] = {"4","Syntax: .server restart cancel Cancel the restart/shutdown timer if any."},
	["server set motd"] = {"5","Syntax: .server set motd $MOTD Set server Message of the day."},
	["server shutdown"] = {"4","Syntax: .server shutdown #delay [#exit_code] Shut the server down after #delay seconds. Use #exit_code or 0 as program exit code."},
	["server shutdown cancel"] = {"4","Syntax: .server shutdown cancel Cancel the restart/shutdown timer if any."},
	["setskill"] = {"4","Syntax: .setskill #skill #level [#max] Set a skill of id #skill with a current skill value of #level and a maximum value of #max (or equal current maximum if not provide) for the selected character. If no character is selected, you learn the skill."},
	["showarea"] = {"2","Syntax: .showarea #areaid Reveal the area of #areaid to the selected character. If no character is selected, reveal this area to you."},
	["stable"] = {"4","Syntax: .stable Show your pet stable."},
	["start"] = {"2","Syntax: .start Teleport you to the starting area of your character."},
	["stopxp"] = {"0","Syntax: .stopxp on/off"},
	["taxicheat"] = {"4","Syntax: .taxicheat on/off Temporary grant access or remove to all taxi routes for the selected character. If no character is selected, hide or reveal all routes to you. Visited taxi nodes sill accessible after removing access."},
	["tele"] = {"2","Syntax: .tele #location Teleport player to a given location."},
	["tele add"] = {"4","Syntax: .tele add $name Add current your position to .tele command target locations list with name $name."},
	["tele del"] = {"4","Syntax: .tele del $name Remove location with name $name for .tele command locations list."},
	["tele group"] = {"2","Syntax: .tele group#location Teleport a selected player and his group members to a given location."},
	["tele name"] = {"2","Syntax: .tele name [#playername] #location Teleport the given character to a given location. Character can be offline."},
	["ticket"] = {"1","Syntax: .ticket on         .ticket off         .ticket #num         .ticket $character_name         .ticket respond #num $response         .ticket respond $character_name $response on/off for GMs to show or not a new ticket directly, $character_name to show ticket of this character, #num to show ticket #num."},
	["trigger"] = {"4","Syntax: .trigger [#trigger_id|$trigger_shift-link|$trigger_target_shift-link] Show detail infor about areatrigger with id #trigger_id or trigger id associated with shift-link. If areatrigger id or shift-link not provided then selected nearest areatrigger at current map."},
	["trigger active"] = {"4","Syntax: .trigger active Show list of areatriggers wiht activation zone including current character position."},
	["trigger near"] = {"4","Syntax: .trigger near [#distance] Output areatriggers at distance #distance from player. If #distance not provided use 10 as default value."},
	["unaura"] = {"3","Syntax: .unaura #spellid Remove aura due to spell #spellid from the selected Unit."},
	["unban account"] = {"3","Syntax: .unban account $Name Unban accounts for account name pattern."},
	["unban character"] = {"3","Syntax: .unban character $Name Unban accounts for character name pattern."},
	["unban ip"] = {"3","Syntax : .unban ip $Ip Unban accounts for IP pattern."},
	["unban last"] = {"3","Syntax: .unban last Remove your last ban."},
	["unlearn"] = {"3","Syntax: .unlearn #spell [all] Unlearn for selected player a spell #spell.  If 'all' provided then all ranks unlearned."},
	["unmute"] = {"2","Syntax: .unmute $playerName Restore chat messaging for any character from account of character $playerName."},
	["waterwalk"] = {"2","Syntax: .waterwalk on/off Set on/off waterwalk state for selected player."},
	["wchange"] = {"2","Syntax: .wchange #weathertype #status Set current weather to #weathertype with an intensity of #status. #weathertype can be 1 for rain, 2 for snow, and 3 for sand. #status can be 0 for disabled, and 1 for enabled."},
	["whispers"] = {"1","Syntax: .whispers on|off Enable/disable accepting whispers by GM from players. By default use mangosd.conf setting."},
	["wp add"] = {"3","Syntax: .wp add [#creature_guid or Select a Creature]"},
	["wp export"] = {"3","Syntax: .wp export [#creature_guid or Select a Creature] $filename"},
	["wp import"] = {"3","Syntax: .wp import $filename"},
	["wp modify"] = {"3","Syntax: .wp modify [#creature_guid or Select a Creature] add - Add a waypoint after the selected visual waittime $time emote ID spell ID text1| text2| text3| text4| text5 <text> model1 ID model2 ID move(moves wp to player pos) del (deletes the wp) Only one parameter per time!"},
	["wp show"] = {"2","Syntax: .wp show [#creature_guid or Select a Creature] on first last off info For using info you have to do first show on and than select a Visual-Waypoint and do the show info!"},
	["auction item"] = {"5","Syntax: .auction item (alliance|horde|goblin) #itemid[:#itemcount] [[#minbid] #buyout] [short|long|verylong] Add new item (in many stackes if amount grater stack size) to specific auction house at short|long|verylogn perios similar same settings in auction in game dialog. Created auction not have owner."},
	["ahbot rebuild"] = {"5","Syntax: .ahbot rebuild [all] Expire all actual auction of ahbot except bided by player. Binded auctions included to expire if all option used. Ahbot re-fill auctions base at current settings then."},
	["ahbot items amount yellow"] = {"4","Syntax: .ahbot items amount yellow $YellowItems Set amount of Yellow color items be selled on auction."},
	["ahbot items ratio"] = {"4","Syntax: .ahbot items ratio $allianceratio $horderatio $neutralratio Set ratio of items in 3 auctions house."},
	["ahbot items ratio alliance"] = {"4","Syntax: .ahbot items ratio alliance $allianceratio Set ratio of items in alliance auction house."},
	["ahbot items ratio horde"] = {"4","Syntax: .ahbot items ratio horde $horderatio Set ratio of items in horde auction house."},
	["ahbot items ratio neutral"] = {"4","Syntax: .ahbot items ratio neutral $neutralratio Set ratio of items in $neutral auction house."},
	["ahbot items amount orange"] = {"4","Syntax: .ahbot items amount orange $OrangeItems Set amount of Orange color items be selled on auction."},
	["ahbot items amount purple"] = {"4","Syntax: .ahbot items amount purple $PurpleItems Set amount of Purple color items be selled on auction."},
	["ahbot items amount blue"] = {"4","Syntax: .ahbot items amount blue $BlueItems Set amount of Blue color items be selled on auction."},
	["ahbot items amount green"] = {"4","Syntax: .ahbot items amount green $GreenItems Set amount of Green color items be selled on auction."},
	["ahbot items amount grey"] = {"4","Syntax: .ahbot items amount grey $GreyItems Set amount of Grey color items be selled on auction."},
	["ahbot items amount white"] = {"4","Syntax: .ahbot items amount white $WhiteItems Set amount of White color items be selled on auction."},
	["ahbot items amount"] = {"4","Syntax: .ahbot items amount $GreyItems $WhiteItems $GreenItems $BlueItems $PurpleItems $OrangeItems $YellowItems Set amount of each items color be selled on auction."},
	["ahbot reload"] = {"5","Syntax: .ahbot reload Reload AHBot settings from configuration file."},
	["ahbot status"] = {"4","Syntax: .ahbot status [all] Show current ahbot state data in short form, and with all with details."},
	["character hasitem"] = {"3","Syntax: .character hasitem #itemid/[#itemname]/#shift-click-item-link Checks if the targeted character (or yourself if no target) has a number of items of id #itemid in the inventory and bank."},
	["quest status"] = {"2","Syntax: .quest complete #questid Display status for current and prevent quests if exists."},
	["list auras"] = {"2","Syntax: .list auras Show all auras currently affecting selected unit or self."}
}